import React, { useState } from 'react';

const CompleteButton = ({ action }) => {
    return (
        <form className="completed-checkbox">
            <input
                id="checkbox"
                name=""
                value="1"
                type="checkbox"
                onClick={action}
            />
            <label htmlFor="checkbox"></label>
        </form>
    );
}

export default CompleteButton;
